Information
------------------------------

Giant Pandas
The Giant Panda is one of the world's most iconic bears, but they are also critically endangered. Now the race is on to save them from extinction. Follow the incredible journey of breeding a panda in captivity, to its dramatic release into the wild. We will witness firsthand the groundbreaking initiative to increase the panda population and raise awareness about this endangered species. For the first time ever, a mother panda is filmed raising her young cub in the wilds of China's remote Qinling Mountains. The Giant Panda has nestled in this stark landscape since the last ice age.

